import PropTypes from 'prop-types';
import Table from '../shared/Table/Table';

const columns = [
    {
        title: 'First Name',
        dataIndex: 'fistName',
    },
    {
        title: 'Last Name',
        dataIndex: 'lastName',
    },
    {
        title: 'Email',
        dataIndex: 'email',
    },
    {
        title: 'Password',
        dataIndex: password,
    },
];

const History = props => {
    return <Table columns={columns} />;
};

History.propTypes = {};

export default History;
